import React from 'react';
import axios from 'axios';

import Grid from '@material-ui/core/Grid';

import Cards from '../Cards';

const tags = ['컴퓨터', '개발자', '공부중', '프로그래머'];

const List = () => {
  const [datas, setDatas] = React.useState([]);
  const [value, setVaule] = React.useState(4);
  const [bbs, setBbs] = React.useState([]);

  React.useEffect(() => {
    axios
      .get('http://192.168.0.104:5000/board/bbslist')
      .then(data => setDatas(data.data));
  }, []);

  const getList = () => {
    let bbs = [];
    setBbs(datas.slice(0, value));
  };

  return (
    <Grid container spacing={3} style={{ width: '90%' }}>
      {datas.map(data => (
        <Grid item xs={4}>
          <Cards
            key={data.bno}
            title={data.title}
            content={data.content}
            date={data.regdate}
            writer={data.writer}
            tag={tags}
          />
        </Grid>
      ))}
    </Grid>
  );
};

export default List;
